import React from 'react'
import './Scheme.css';

const Scheme = () => {
    return (
        <div className="scheme">
            <div className="scheme-name">
                <h4>name of policy is here</h4>
            </div>
            <div className="scheme-data">
                <p>Some data</p>
                <button>Some button</button>
            </div>
        </div>
    )
}

export default Scheme
